import Keycloak from "keycloak-js";

const keycloak = new Keycloak({
  url: "https://payco-keycloak-gke0hzgqd4dhcbg5.westus2-01.azurewebsites.net/",
  realm: "payco-realm",
  clientId: "payco-app",
});

export default keycloak;
